// src/pages/Financial.js
import React, { useEffect, useState } from 'react';
import BusinessNavBar from '../components/BusinessNavBar';
import LineChart from '../components/LineChart';
import '../styles/Financial.css';

// Mock data (You can replace this with API call)
const mockData = [
  { month: 'January', income: 4000 },
  { month: 'February', income: 3000 },
  { month: 'March', income: 5000 },
  { month: 'April', income: 7000 },
  { month: 'May', income: 6000 },
  { month: 'June', income: 8000 },
];

const fetchIncomeData = async () => {
  return new Promise((resolve) => setTimeout(() => resolve(mockData), 1000));
};

const Financial = () => {
  const [incomeData, setIncomeData] = useState([]);

  useEffect(() => {
    fetchIncomeData().then((data) => setIncomeData(data));
  }, []);

  return (
    <div>
      <BusinessNavBar />
      <div className="financial-container">
        <h1>Financial Page</h1>
        <div className="chart-container">
          <LineChart data={incomeData} />
        </div>
      </div>
    </div>
  );
};

export default Financial;
